import{_ as t,c as a,o as i,aj as r,aI as s,aJ as o,aK as l,aL as n,aM as c,aN as d,aO as p,aP as m,aC as h,aD as u,aQ as g,aR as y,aS as _,at as f,aT as v,aU as b}from"./chunks/framework.D6_Aedov.js";const M=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"deezer.md","filePath":"deezer.md"}'),x={name:"deezer.md"};function w(k,e,P,D,q,z){return i(),a("div",null,[...e[0]||(e[0]=[r('<h2 id="_1-preparation" tabindex="-1">1. Preparation <a class="header-anchor" href="#_1-preparation" aria-label="Permalink to “1. Preparation”">​</a></h2><p>Before using the Deezer music service, you need to prepare a valid Deezer account.</p><p>For first-time login, open Deezer on your device under &quot;Streaming&quot; - &quot;Music&quot;, or open it in the Eversolo Control app under &quot;Discover&quot; - &quot;Music Services&quot;. Follow the on-screen prompts to complete login.</p><div class="two-images"><img src="'+s+'" alt=""><img src="'+o+'" alt=""></div><h2 id="_2-log-in" tabindex="-1">2. Log In <a class="header-anchor" href="#_2-log-in" aria-label="Permalink to “2. Log In”">​</a></h2><p>Please enter your Deezer account and password on your device or Eversolo Control APP to log in.</p><p>If you haven&#39;t created a Deezer account yet, please click &#39;&#39;Register here&#39;&#39; on the device and follow the prompts to complete account registration.</p><div class="two-images"><img src="'+l+'" alt=""><img src="'+n+'" alt=""></div><h2 id="_3-browsing" tabindex="-1">3. Browsing <a class="header-anchor" href="#_3-browsing" aria-label="Permalink to “3. Browsing”">​</a></h2><p>After successfully logging in, you can browse Deezer music on your device or the Eversolo Control APP. At the top of the interface, you will see sections for Flow, Charts, New Releases, Mixes, Genres, My Library.</p><p>You can browse these categories layer by layer to access various Deezer music recommendations. In My Library section, you can also view your saved user-created playlists, albums, tracks, artists and podcasts.</p><div class="two-images"><img src="'+c+'" alt=""><img src="'+d+'" alt=""></div><h2 id="_4-search" tabindex="-1">4. Search <a class="header-anchor" href="#_4-search" aria-label="Permalink to “4. Search”">​</a></h2><p>Click the search box at the top to search the entire Deezer music library for Artists, Albums, Tracks, Playlists, Podcasts and other content you want, quickly locating your desired music resources.</p><div class="two-images"><img src="'+p+'" alt=""><img src="'+m+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_5-more" tabindex="-1">5. More <a class="header-anchor" href="#_5-more" aria-label="Permalink to “5. More”">​</a></h2><p>In the browsing interface, you can access the more functions menu by clicking the &quot;<img class="imgIcon" src="'+h+'" alt="">&quot; icon to the right of the track, or the &quot;<img class="imgIcon" src="'+u+'" alt="">&quot; icon in the upper right corner of the album/playlist.</p><p>This menu supports the following functions:</p><table tabindex="0"><thead><tr><th style="text-align:left;">More menus for singles</th><th style="text-align:left;">More menus for albums/playlists</th></tr></thead><tbody><tr><td style="text-align:left;">Play now / Play next</td><td style="text-align:left;">Play all tracks now</td></tr><tr><td style="text-align:left;">Add to the end of play queue</td><td style="text-align:left;">Add all tracks to the next play</td></tr><tr><td style="text-align:left;">Add to device playlist</td><td style="text-align:left;">Add all tracks to the end of play queue</td></tr><tr><td style="text-align:left;">Favorite to Deezer</td><td style="text-align:left;">Add to device playlist</td></tr><tr><td style="text-align:left;">Add to Deezer playlist</td><td style="text-align:left;">Favorite to Deezer</td></tr><tr><td style="text-align:left;">View artist</td><td style="text-align:left;">Add all tracks to Deezer playlist</td></tr></tbody></table><p><strong>Tips:</strong></p><ul><li>Saved content can be viewed and managed at any time in the &quot;My Library&quot; section.</li><li>Content added to the device playlist can be viewed and managed centrally in My Favotites- Device playlists.</li></ul><div class="two-images"><img src="'+g+'" alt=""><img src="'+y+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_6-streaming-quality" tabindex="-1">6. Streaming Quality <a class="header-anchor" href="#_6-streaming-quality" aria-label="Permalink to “6. Streaming Quality”">​</a></h2><p>When playing Deezer music, you can click the &#39;<img class="imgIcon" src="'+_+'" alt="">&#39; icon in the top right corner of the homepage, or click the &#39;<img class="imgIcon" src="'+f+'" alt="">&#39; icon on the playback details interface to select the streaming quality mode.</p><p>Supported options include:</p><ul><li>Low</li><li>Medium（128 kb/s）</li><li>Hight（320 kb/s）</li><li>Lossless（CD-Quality）</li><li>HiRes（Master）</li></ul><div class="two-images"><img src="'+v+'" alt=""><img src="'+b+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div>',30)])])}const S=t(x,[["render",w]]);export{M as __pageData,S as default};
